	  d_msg_rpbbucketkeypreflistitem(Bin);
      rpbgetbucketkeypreflistresp ->
	  d_msg_rpbgetbucketkeypreflistresp(Bin);
      rpblistbucketsresp -> d_msg_rpblistbucketsresp(Bin);
      rpbputresp -> d_msg_rpbputresp(Bin);
      rpbgetclientidresp -> d_msg_rpbgetclientidresp(Bin);
      rpbsetbuckettypereq -> d_msg_rpbsetbuckettypereq(Bin);
      rpbgetbuckettypereq -> d_msg_rpbgetbuckettypereq(Bin);
