				    N, Acc, F1, F2, F3, _, F5, F6, F7, F8, F9,
				    F10, F11) ->
    Len = X bsl N + Acc,
    <<Bytes:Len/binary, Rest2/binary>> = Rest,
    NewFValue = binary:copy(Bytes),
    dfp_read_field_def_rpbcontent(Rest2, 0, 0, F1, F2, F3,
				  NewFValue, F5, F6, F7, F8, F9, F10, F11).


